class ToggleLike{constructor(t){this.toggler=t,this.toggleLike()}toggleLike(){$(this.toggler).click(function(t){t.preventDefault();let e=this;$.ajax({type:"POST",url:$(e).attr("href")}).done(function(t){let a=parseInt($(e).attr("data-likes"));console.log(a),1==t.data.deleted?(a-=1,$(e).attr("data-likes",a),$(e).html(`<i class="far fa-thumbs-up fa-2x"></i> ${a} Likes`)):(a+=1,$(e).attr("data-likes",a),$(e).html(`<i class="fas fa-thumbs-up fa-2x"></i> ${a} Likes`))}).fail(function(t){console.log("error in completing the request")})})}}